import React from 'react';
import './Exchanger.scss';


class Exchanger extends React.Component {
  constructor(props) {
    super (props);
  }

  render () {
    return (
        <fieldset className="app-exchanger">
            <legend className="USD">Enter currency in $, USD</legend>
            <label for="USD">USD</label>
            <Input id="USD" placeholder="BYN"></Input>
        </fieldset>
    );
  }
}


class Input extends React.Component {
    constructor(props) {
      super (props);
    }

    render () {
      return (
        <input id={this.props.id} type={this.props.type} placeholder={this.props.placeholder}></input>
      );
    }
}


export {Exchanger};
